import "../styles/sousmenu.css";
const SousMenu = ({ nameSousMenu, icon }) => {
  return (
    <>
      <div className="container">
        <img id="icon" src={icon} />
        <p>{nameSousMenu}</p>
      </div>
    </>
  );
};
export default SousMenu;
